import './App.css';
import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    axios.get('/getvideos').then((response) => {
      setVideos(response.data);
      console.log(response.data)
    })
  })
}  
export default App;
